<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">With Markdown you can just start writing text. It&#39;s easy to emphasise single </span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;--shiki-light-font-style:italic;--shiki-dark-font-style:italic;">_words_</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> or </span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;--shiki-light-font-style:italic;--shiki-dark-font-style:italic;">_whole phrases of text_</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">. Making words </span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;--shiki-light-font-weight:bold;--shiki-dark-font-weight:bold;">**bold**</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> is simply a </span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;--shiki-light-font-weight:bold;--shiki-dark-font-weight:bold;">**different**</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> set of annotations to </span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;--shiki-light-font-style:italic;--shiki-dark-font-style:italic;">_italic_</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">. You can even commit major crimes against the spirits of style by </span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;--shiki-light-font-weight:bold;--shiki-dark-font-weight:bold;">**combining bold and </span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;--shiki-light-font-style:italic;--shiki-dark-font-style:italic;">_italic_</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;--shiki-light-font-weight:bold;--shiki-dark-font-weight:bold;">**</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">. Maybe we can just </span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">~~scratch this.~~</span></span>
