<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">It&#39;s easy to create hyperlinks to external [</span><span style="--shiki-light:#032F62;--shiki-dark:#DBEDFF;--shiki-light-text-decoration:underline;--shiki-dark-text-decoration:underline;">websites</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">](</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;--shiki-light-text-decoration:underline;--shiki-dark-text-decoration:underline;">https://www.janga.la</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">). Image links are also easy to create:</span></span>
